import React from "react";
import Row from "../components/Row";
import "./Rows.css";

const fetchParams = {
  trending: "trending/all/week",
  netflixOriginals: "discover/tv"
};

const Rows = () => {
  return (
    <div>
      <Row title="Trending" fetchParam={fetchParams.trending} />
      {/* <Row
        title="Netflix Originals"
        fetchParam={fetchParams.netflixOriginals}
      /> */}
    </div>
  );
};

export default Rows;
